CREATE TABLE ActivityLog (
    activityID SERIAL PRIMARY KEY NOT NULL,
    userID BIGINT UNSIGNED,
    nomineeID BIGINT UNSIGNED,
    type VARCHAR(50),
    FOREIGN KEY (userID)
        REFERENCES Users (ID)
        ON DELETE CASCADE,
    FOREIGN KEY (nomineeID)
        REFERENCES Nominees (ID)
        ON DELETE CASCADE
);

